    display: flex;
    width: 1240px;
`

const ImgError = styled.img`
width: 800px;
margin-bottom: 50px;
`

const IndexError = styled.div`
display: flex;
    width: 1240px;
    flex-direction: column;
    align-items: center;
`

// en jsx le className n'est pas visible...

function Error(){
    return (
        <div className="IndexError">
            <StyleError>
                <ImgError src={Error_404} alt="Error"/>
                <IndexError>Oups! La page que vous demandez n'existe pas.</IndexError>
            </StyleError>

        </div>

    )
}

export default Error
